INSERT INTO `email_templates` (`id`, `id_company`, `name`, `subject`, `message`, `id_ctg`)
VALUES
	(1,1,'First Request','{FIRST_NAME}, can you help me out?','<p>{FIRST_NAME},<br /> <br />I know you had a great experience at {BUSINESS} and was wondering if you could do me a quick 15 second favor.<br /> <br />Could   you record a video testimonial for us? Simply visit this page I  promise  it will only take a few seconds and would be forever  appreciative.<br /> <br />Thanks for your help. Warmest Regards, {OWNER} {BUSINESS}</p>',1),
	(2,1,'Second Request','{FIRST_NAME}, what happened?','<p>{FIRST_NAME},</p>\r\n<p>&nbsp;</p>\r\n<p>Saw that you were in the other day but didn\'t buy.</p>\r\n<p>&nbsp;</p>\r\n<p>Can you give me a little bit of insight on what happened?</p>\r\n<p>&nbsp;</p>\r\n<p>Thanks,</p>\r\n<p>Gus</p>',1),
	(69,1,'Are you still interested in our services?Hello {CONTACT_NAME},','Are you still interested in our services?Hello {CONTACT_NAME},','<p>We wanted to follow up with you to see if you are still in the market for our services. We understand that things can change quickly, and we want to make sure that we are providing you with the most up-to-date information.<br /><br />If you are still interested in our services, please reply back to this email or text us at 800-555-1212. We would be happy to answer any questions you may have and provide you with more information about our offerings.<br /><br />Thank you for considering {BUSINESS} for your needs. We look forward to hearing back from you soon.<br /><br />Best regards,<br /><br />{BUSINESS}<br /><br /></p>',1),
	(70,1,'Just checking inHello {CONTACT_NAME},','Just checking inHello {CONTACT_NAME},','<p>We wanted to touch base with you again to see if you are still interested in our services. We understand that things can get busy, and we don\'t want you to miss out on the opportunity to work with us.<br /><br />If you are still interested, please let us know by replying back to this email or texting us at 800-555-1212. We would be happy to answer any questions you may have and provide you with more information about our offerings.<br /><br />Thank you for considering {BUSINESS}. We hope to hear back from you soon.<br /><br />Best regards,<br /><br />{BUSINESS}<br /><br /></p>',1),
	(71,1,'Final follow-upHello {CONTACT_NAME},','Final follow-upHello {CONTACT_NAME},','<p>This is our final follow-up to see if you are still interested in our services. We understand that things can change quickly, and we don\'t want to bother you if you are no longer in the market for what we offer.<br /><br />If you are still interested, please let us know by replying back to this email or texting us at 800-555-1212. We would be happy to answer any questions you may have and provide you with more information about our offerings.<br /><br />Thank you for considering {BUSINESS}. We appreciate your time and hope to hear back from you soon.<br /><br />Best regards,<br /><br />{BUSINESS}</p>',1),
	(72,1,'','Don\'t Miss Our Home Show Next Week!Dear {CONTACT_NAME},Are you looking for a new door for your home? Then you won\'t want to miss {BUSINESS}\'s Home Show next week at the Fairgrounds! We\'ll be in booth 12 at the North End, and we\'re excited to show you our latest products.','<p><br /><br />In addition to our great selection of doors, we\'ll also be holding a raffle for a FREE Door! And that\'s not all - we\'ll have food and entertainment to make your visit even more enjoyable.<br /><br /><br /><br />So mark your calendar for next week and come see us at the Fairgrounds. We can\'t wait to meet you!<br /><br />Best regards,<br /><br />{BUSINESS}<br /><br /></p>',1),
	(73,1,'Reminder: Home Show Next Week!Dear {CONTACT_NAME},Just a quick reminder that {BUSINESS}\'s Home Show is happening next week at the Fairgrounds! We\'ll be in booth 12 at the North End, and we\'re excited to show you our latest products.','Reminder: Home Show Next Week!Dear {CONTACT_NAME},Just a quick reminder that {BUSINESS}\'s Home Show is happening next week at the Fairgrounds! We\'ll be in booth 12 at the North End, and we\'re excited to show you our latest products.','<p><br /><br />Don\'t forget that we\'ll be holding a raffle for a FREE Door, and we\'ll have food and entertainment to make your visit even more enjoyable.<br /><br /><br /><br />We hope to see you there!<br /><br />Best regards,<br /><br />{BUSINESS}<br /><br /></p>',1),
	(74,1,'','Last Chance to RSVP for Our Home Show!Dear {CONTACT_NAME},We\'re getting ready for {BUSINESS}\'s Home Show next week at the Fairgrounds, and we don\'t want you to miss out! We\'ll be in booth 12 at the North End, and we\'re excited to show you our latest products.','<p><br /><br />Remember, we\'ll be holding a raffle for a FREE Door, and we\'ll have food and entertainment to make your visit even more enjoyable.<br /><br /><br /><br />Please let us know if you\'ll be able to attend by RSVPing to this email. We can\'t wait to see you there!<br /><br />Best regards,<br /><br />{BUSINESS}<br /><br /></p>',1),
	(75,1,'Thank You for Visiting Our Home Show!Dear {CONTACT_NAME},Thank you for visiting {BUSINESS}\'s Home Show last week at the Fairgrounds! We hope you enjoyed seeing our latest products and had a great time at the event.','Thank You for Visiting Our Home Show!Dear {CONTACT_NAME},Thank you for visiting {BUSINESS}\'s Home Show last week at the Fairgrounds! We hope you enjoyed seeing our latest products and had a great time at the event.','<p><br /><br />We also wanted to remind you that we\'re still holding a raffle for a FREE Door. If you haven\'t already, be sure to enter for your chance to win!<br /><br /><br /><br />Thank you again for your support, and we hope to see you soon.<br /><br />Best regards,<br /><br />{BUSINESS}</p>',1),
	(76,1,'','Subject: Introducing Our Social Media Management Offer for ChiropractorsDear {CONTACT_NAME},Are you struggling to manage your social media accounts while running your chiropractic practice? We understand that social media can be time-consuming and overwhelming, which is why we are excited to introduce our new social media management offer for chiropractors.','<p><br /><br />Our offer includes managing up to 5 social media accounts with up to 3 posts per day, per platform. We will create and curate content that is tailored to your chiropractic practice and engage with your followers to increase your online presence.<br /><br />We are only accepting one chiropractor in each city to ensure that we can provide personalized attention to your social media accounts. Our pricing for this service is $899 per month.<br /><br /><br /><br />If you are interested in learning more about our social media management offer, please click the link below to book a call with us. We would love to discuss how we can help grow your online presence and attract more patients to your practice.<br /><br /><br /><br />Click here to book a call: {BOOK_A_CALL_LINK}<br /><br />Thank you for considering our social media management offer for chiropractors.<br /><br />Best regards,<br /><br />{BUSINESS}</p>',1),
	(77,1,'Demo1','Demo1','<p><br /><br />Subject: {SUBJECT} Book Another Call to Discuss Your Progress<br /><br />Dear {CONTACT_NAME},<br /><br />I hope this email finds you well. I wanted to follow up on our last call and see if you would be interested in booking another 30-minute call to discuss your progress.<br /><br />During the call, we can review your progress and identify areas where you can improve. As always, you will receive a transcription of the call and 3 bullet points on what you can do to improve.<br /><br />Please let me know if you are interested in booking another call. I look forward to hearing from you soon.<br /><br />Best regards,<br /><br />{BUSINESS}<br /><br /></p>',1),
	(78,1,'Demo2','Demo2','<p><br /><br />Subject: {SUBJECT} Let\'s Schedule Another Call to Discuss Your Progress<br /><br />Dear {CONTACT_NAME},<br /><br />I hope this email finds you well. I wanted to touch base and see if you would like to schedule another 30-minute call to discuss your progress.<br /><br />During the call, we can review your progress and identify areas where you can improve. You will receive a transcription of the call and 3 bullet points on what you can do to improve.<br /><br />Please let me know if you are interested in scheduling another call. I look forward to hearing from you soon.<br /><br />Best regards,<br /><br />{BUSINESS}<br /><br /></p>',1),
	(79,1,'Demo3','Demo3','<p><br /><br />Subject: {SUBJECT} Book Another Call to Review Your Progress<br /><br />Dear {CONTACT_NAME},<br /><br />I hope this email finds you well. I wanted to reach out and see if you would like to book another 30-minute call to review your progress.<br /><br />During the call, we can discuss your progress and identify areas where you can improve. You will receive a transcription of the call and 3 bullet points on what you can do to improve.<br /><br />Please let me know if you are interested in booking another call. I look forward to hearing from you soon.<br /><br />Best regards,<br /><br />{BUSINESS}</p>',1),
	(18,1,'RE CRM','The preferred Real Estate CRM Platform','<p>Hi&nbsp;{FIRST_NAME}, Do you need more listings? Or maybe clients?&nbsp; Willard is a power RE CRM platform that allow agents to keep up with new clients and move them along the sales cycle.&nbsp; Fully automated and customizable, giving you an edge over the competition.</p>\r\n<p>&nbsp;</p>\r\n<p>Matter of fact, we are using Willard now.&nbsp; If you would like some more information on how we provide other agents with CRM solutions let me know.&nbsp; I would be happy to jump on a quick call.</p>\r\n<p>&nbsp;</p>\r\n<p>We look forward to hearing from you!</p>\r\n<p>&nbsp;</p>\r\n<table id=\"admintable0\" class=\"table table-striped table-editable no-margin mb-sm admintable table table-striped table-hover\" border=\"0\" width=\"100%\">\r\n<tbody>\r\n<tr class=\"admintable_row at-row-0 at-row-pair\">\r\n<td id=\"at0-cell-twiliophone-0\" class=\"at-cell-twiliophone\">\r\n<p>Chandler,</p>\r\n<div>Sr. Account Executive.</div>\r\n<div>(202) 519-5956</div>\r\n<div>willardcrm@gmail.com</div>\r\n<div>\r\n<p><span style=\"font-family: mceinline;\">www.meetwillard.com</span></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>',17),
	(64,1,'Free Trial PK','Willard CRM -Simplified Free Trial ','<p><span style=\"color: #171725; font-family: Poppins, sans-serif; font-size: 12.5px; background-color: #f9f9f9;\">{FIRST_NAME},</span></p>\r\n<p>Currently, we are offering a Free Trial for two weeks. Would you want to set up a time for a demo and sign up?</p>\r\n<p><span style=\"font-size: 12pt;\"><strong><em><sub><span style=\"color: rgba(0, 0, 0, 0.6); font-family: -apple-system, system-ui, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', \'Fira Sans\', Ubuntu, Oxygen, \'Oxygen Sans\', Cantarell, \'Droid Sans\', \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Lucida Grande\', Helvetica, Arial, sans-serif; white-space: pre-wrap; background-color: #ffffff;\">1. Willard is the preferred small business CRM platform to identify, engage, and track opportunities. SMS, email, and voice engagement and tracking.<br /></span></sub></em><em><sub><span style=\"color: rgba(0, 0, 0, 0.6); font-family: -apple-system, system-ui, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', \'Fira Sans\', Ubuntu, Oxygen, \'Oxygen Sans\', Cantarell, \'Droid Sans\', \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Lucida Grande\', Helvetica, Arial, sans-serif; white-space: pre-wrap; background-color: #ffffff;\">2. We Have Empowered Hundreds of Businesses with Features to Engage and Track Opportunities. <br />3. Automatically Log All Inbound and Outbound Emails, Calls, and Text Messages. You Can Drag and Drop Leads into Opportunities. 4. Manage your pre and post-sale follow-ups, stay on top of client projects, collection tracking, and more.</span></sub></em></strong></span></p>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\">\r\n<div dir=\"ltr\" data-smartmail=\"gmail_signature\">\r\n<div dir=\"ltr\">\r\n<div>Paul Kim - Director of Client Development&nbsp;</div>\r\n<div>Meet Willard - 571-548-1210<br /><a style=\"color: #1155cc;\" href=\"mailto:sales@hiwillard.com\" target=\"_blank\" rel=\"noopener\">sales@hiwillard.com</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<p><img class=\"CToWUd\" style=\"background-color: #ffffff; color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small;\" src=\"https://ci3.googleusercontent.com/mail-sig/AIorK4xUmvSC-uJ1wbGvC7pF_8_D8RbTLuZwWqxPQLwY3qYH6RUrRojETIl3X6AqkqZYeeuCMh3jrCs\" width=\"96\" height=\"96\" data-bit=\"iit\" /></p>',46),
	(65,1,'Follow up #2','Quick question ','<p>Hi {FIRST_NAME}, Do you need more Leads? Or maybe clients? Willard is a powerful CRM platform that allows Sales reps to keep up with new clients and move them along the sales cycle. Fully automated and customizable, giving you an edge over the competition.</p>\r\n<p>We are using Willard now. Let me know if you want more information on how we provide other agents with CRM solutions. I would be happy to jump on a quick call.</p>\r\n<p>We look forward to hearing from you!</p>',46),
	(67,1,'POC ','Intro POC','<p>Good Day&nbsp;<span style=\"background-color: #f9f9f9; color: #171725; font-family: Poppins, sans-serif; font-size: 12.5px;\">{FIRST_NAME},</span></p>\r\n<p><span style=\"background-color: #f9f9f9; color: #171725; font-family: Poppins, sans-serif; font-size: 12.5px;\">Could you kindly help me point directly to the Main POC for Sales and Marketing within the </span><span style=\"background-color: #f9f9f9; color: #171725; font-family: Poppins, sans-serif; font-size: 12.5px;\">{CONTACT_BUSINESS_NAME} about CRM?</span></p>\r\n<p><span style=\"color: #171725; font-family: Poppins, sans-serif;\"><span style=\"font-size: 12.5px; background-color: #f9f9f9;\">I appreciate any help you can provide.</span></span></p>\r\n<p><span style=\"background-color: #f9f9f9; color: #171725; font-family: Poppins, sans-serif; font-size: 12.5px;\">Best,</span></p>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\">Paul Kim - Director of Client Development&nbsp;</div>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\">Meet Willard - 571-548-1210<br /><a style=\"color: #1155cc;\" href=\"mailto:sales@hiwillard.com\" target=\"_blank\" rel=\"noopener\">sales@hiwillard.com</a></div>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\"><img class=\"CToWUd\" src=\"https://ci3.googleusercontent.com/mail-sig/AIorK4xUmvSC-uJ1wbGvC7pF_8_D8RbTLuZwWqxPQLwY3qYH6RUrRojETIl3X6AqkqZYeeuCMh3jrCs\" width=\"96\" height=\"96\" data-bit=\"iit\" /></div>',46),
	(68,1,'10%','Special Discount + Free Trial CRM','<p><span style=\"font-family: Poppins, sans-serif; font-size: 14px; background-color: #ffffff;\">{FIRST_NAME}, It\'s the End of the Year, and Williard CRM is offering 10% off the list price @ $40 per month VS Sales Force @ $1100. Want to know more about the Free Trial? Reply.&nbsp;</span></p>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\">Paul Kim - Director of Client Development&nbsp;</div>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\">Meet Willard - 571-548-1210<br /><a style=\"color: #1155cc;\" href=\"mailto:sales@hiwillard.com\" target=\"_blank\" rel=\"noopener\">sales@hiwillard.com</a></div>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\"><img class=\"CToWUd\" src=\"https://ci3.googleusercontent.com/mail-sig/AIorK4xUmvSC-uJ1wbGvC7pF_8_D8RbTLuZwWqxPQLwY3qYH6RUrRojETIl3X6AqkqZYeeuCMh3jrCs\" width=\"96\" height=\"96\" data-bit=\"iit\" /></div>',46),
	(62,1,'End of the Year - Willard Follow up','End of the Year - Willard Follow up','<p><span style=\"color: #171725; font-family: arial, helvetica, sans-serif; font-size: 12pt; background-color: #f9f9f9;\">Hi {FIRST_NAME},</span></p>\r\n<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">We are offering a special discount on our CRM Platform before the year-end. Would you be interested in seeing how we compete with competitors like Hubspot, salesforce, and Compass?</span></div>\r\n<div>&nbsp;</div>\r\n<div><strong><span style=\"font-size: var(--wp--preset--font-size--x-large); background-color: #ffffff; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen-Sans, Ubuntu, Cantarell, \'Helvetica Neue\', sans-serif;\">Harness the power of MailChimp, HubSpot, and lead generation management in one complete CRM solution.</span></strong></div>\r\n<div>&nbsp;</div>\r\n<div><strong><span style=\"font-size: var(--wp--preset--font-size--x-large); background-color: #ffffff; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen-Sans, Ubuntu, Cantarell, \'Helvetica Neue\', sans-serif;\">Starting at just $49/user? Yes, It\'s Equivalent to Salesloft + Zoominfo + CRM...</span></strong></div>\r\n<div>&nbsp;</div>\r\n<div>Reply if you want to demo the platform.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Thanks!</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<div style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small; background-color: #ffffff;\">\r\n<div dir=\"ltr\" data-smartmail=\"gmail_signature\">\r\n<div dir=\"ltr\">\r\n<div><em>Paul Kim - Director of Client Development&nbsp;</em></div>\r\n<div><em>Meet Willard - 571-548-1210</em><br /><a style=\"color: #1155cc;\" href=\"mailto:sales@hiwillard.com\" target=\"_blank\" rel=\"noopener\">sales@hiwillard.com</a></div>\r\n<div><img class=\"CToWUd\" src=\"https://ci3.googleusercontent.com/mail-sig/AIorK4xUmvSC-uJ1wbGvC7pF_8_D8RbTLuZwWqxPQLwY3qYH6RUrRojETIl3X6AqkqZYeeuCMh3jrCs\" width=\"96\" height=\"96\" data-bit=\"iit\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p style=\"padding-left: 40px;\">&nbsp;</p>\r\n<p style=\"padding-left: 40px;\">&nbsp;</p>',46);
